Director	Mike Quasar
Starring	Karlie Montana, Mr Pete, James Deen, Anthony Rosano, Skin Diamond, Derrick Pierce, AJ Applegate, Tommy Pistol, Romi Rain

Erotic novelist Roz Collins is writing a new book and wants superfan Karlie to become his real-life protagonist, and lover. She's shocked and amazed when the author himself returns her fan mail, and discovers that he's got a very hot, sexy fantasy in store for her. She eagerly follows the story he's written for her, but as she transforms into the sultry Scarlet, it's not clear that she will ever be able to return to her old life!

